def fibonacci(n, memo={}):
    if n < 0:
        return []
    if n == 1:
        return [0]
    elif n == 2:
        return [0, 1]
    if n in memo:
        return memo[n]
    previous_fibonacci = fibonacci(n - 1, memo)
    next_fibonacci = sum(previous_fibonacci[-2:])
    memo[n] = previous_fibonacci + [next_fibonacci]
    return memo[n]

